import React, {Component} from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

import "bootstrap/dist/css/bootstrap.css";
import "./App.css";

import Login from "./components/Login";
import Logout from "./components/Logout";
import AddCar from "./components/AddCar";
import EditCar from "./components/EditCar";
import DeleteCar from "./components/DeleteCar";
import DisplayAllCars from "./components/DisplayAllCars";
import PrivateRoute from './components/PrivateRoute'

if (typeof sessionStorage.isLoggedIn === 'undefined')
{
    sessionStorage.isLoggedIn = 'false';
}


export default class App extends Component 
{
    render() 
    {

        const privateRoutes =  sessionStorage.isLoggedIn==="true" ? `<Route exact path="/AddCar" component={AddCar} />
                              <Route exact path="/EditCar/:id" component={EditCar} />
                              <Route exact path="/DeleteCar/:id" component={DeleteCar} />` : null
        return (
                <BrowserRouter>
                  <Switch>
                    <Route exact path='/' component={DisplayAllCars} />
                    <Route exact path="/Login" component={Login} />
                    <Route exact path="/Logout" component={Logout} />
                    {privateRoutes}
                    <Route exact path="/DisplayAllCars" component={DisplayAllCars}/> 
                    <Route path="*" component={() => <h3>Invalid URL. Webpage does not exist</h3>}/>                            
                  </Switch>
                </BrowserRouter>);
    }
}
